def min_cost(cost, m, n):
    # Base case
    if m == 0 and n == 0:
        return 0
    # Recursive case
    return min(cost[m][n] + min_cost(cost, m - 1, n) + min_cost(cost, m, n - 1),
              cost[m][n] + min_cost(cost, m - 1, n) + min_cost(cost, m, n - 1),
              cost[m][n] + min_cost(cost, m - 1, n) + min_cost(cost, m, n - 1))

def count_ways(n):
    if n == 0:
        return 1
    if n == 1:
        return 1
    if n == 2:
        return 2
    return sum(count_ways(n - 1) + count_ways(n - 2) for _ in range(n - 2))

